"description": "Stainless steel ice cube can be used to cool your whiskey, scotch, vodka, white wine, etc. Unlike ice, whiskey stones chill your liquor without diluting the flavors. \r\n\r\nContents:\r\n3 Stainless Steel Whiskey Stones\r\n1 Cotton Bag for storage\r\n\r\nAdvantages:\r\n\r\n-Chills the spirit quicker than standard ice\r\n-The cubes stay at the bottom of the glass\r\n-Bring a mellow chill to the drink, cooling your spirit without diluting the flavors\r\n-The cube edges are rounded, preventing scratching\r\n-Easy to clean\r\n-The cube doesn&#39;t add any flavors or smells\r\n-Great gift idea\r\n-Not to mention, They look great in the glass!\r\n\r\nHow to use:\r\n\r\nKeep Cold Drinks Cold:\r\n\r\n   - Please wash cubes before first use\r\n   - Place cubes in freezer for 4 hours or more\r\n   - When ready, add 3-4 cubes per drink and enjoy\r\n   - To clean, rinse with warm water and air dry\r\n\r\nWe offer custom engraving on our sets of 6. Please visit:\r\nhttps://www.etsy.com/listing/199049885/custom-engraved-stainless-steel-whiskey?ref=related-2",
