"accepts_custom_requests": false,
"policy_welcome": "Welcome to the Madame&#39;s caravan!",
"policy_payment": "All sales from this shop are done through PayPal or credit card. Your order will not ship until after payment is processed.",
"policy_shipping": "Orders will ship within 2-4 business days of purchase. The Madame ships everything via the US Postal Service. They know her, they love her. They snicker at her beard.\r\n\r\nShipping Overage Refunds for Domestic and International Orders:\r\nIf your shipping price seems way too high, don&#39;t be alarmed. Madame will refund you for any significant overages.",
"policy_refunds": "Generally, all sales are final. There are no refunds or exchanges. If you attempt to return an item that has been used (even slightly), you will not receive a refund.\r\n\r\nIf for some reason you are truly disappointed in your order, don&#39;t hesitate to contact the Madame to discuss your options, and please do so before leaving feedback.\r\n\r\nMadame does not refund shipping fees.",
"policy_additional": "A Note About Solid Perfumes:\r\nThe Madame&#39;s solids will last you a long time. Store at room temperature and remember that the main ingredient is WAX: if left in your car on a hot summer day, be aware that it will melt, so please use caution when opening the tin. (Fragrance will return to it&#39;s solid state once cooled.)\r\n\r\nHow To Use Solid Perfumes:\r\nSimply rub your finger over the surface of the perfume, and then apply to any area of the body, preferably pulse points (your body heat will strengthen the scent). Solid perfumes are for external use only. DO NOT use as lip balm, or on sensitive areas.\r\n\r\nAllergies:\r\nRead all ingredients carefully before ordering, please - especially if you have known allergies to certain fragrances. Please contact the Madame if you have any questions or concerns. She is generally very quick at replying.\r\n\r\nWholesale:\r\nMost items are available for wholesale, and custom orders are welcome. Don&#39;t be afraid to ask! However, we will not do consignment and we will not ship our products to you without labels. It&#39;s the beard or nothing, baby.\r\nIf you are inquiring about a wholesale order, please provide the following info:\r\nâ Your shop name and physical location.\r\nâ Website if possible, or any social media links to your business.\r\nâ Images of your shop (this is very important, as we want to ensure that we will be a good fit in your space).\r\nâ A list of the products you are interested in carrying.\r\n\r\nInternational Orders:\r\nPlease note that packages can be delayed in customs for a number of reasons, and on rare occasion you may have to pay an additional fee to claim your package. We apologize that we have no control over this situation. Also please know your country&#39;s guidelines and restrictions for international packages. The most typical reason for packages held in customs is that an item contained within is prohibited by that country.\r\n\r\nFeedback:\r\nWe are perfectionists and we are pleasers. We receive very little negative feedback, and of course we&#39;d like to keep it that way! We understand that you may not like the scent you ordered â everyone&#39;s nose experiences scents differently. Before leaving any harsh feedback, please do consider other aspects of your experience here. We are quite proud of our customer service and speedy shipping. We work hard to deliver a positive experience with every order. xo",
